window.bookSummaryJSON = "<p>Every witch knows you shouldn't use spells for revenge. Blair doesn't care much for right and wrong, but she's already on the council's radar. What's the best mortal way to get back at a cheating ex-boyfriend? Bewitching his dad, of course.</p> <p>Dax was supposed to be retribution, but he turns out to be so much more. She's drawn to him in a way she has never felt for a man before, but it's clear Dax is so much more than the average man. There's a mystery to him, and she's dead set on figuring him out.</p> <p>With multiple supernatural entities breathing down her neck and her need to avoid the council's wrath, Blair's desperate to get everything she wants. It might take more than she's willing to give to untangle herself from the lies and chaos she's created.</p> <p>Contains mature themes.</p>"; 
